import React from "react";
import { Carousel, Card } from "react-bootstrap";
import tuto from "../assets/tuto.jpg";
import forum from "../assets/forum.jpg";
import projet from "../assets/projet.jpg";
const MyCarousel = () => {
  return (
    <Carousel
      interval={3000}
      className="d-flex justify-content-center align-items-center"
    >
      <Carousel.Item>
        <Card
          style={{ width: "18rem", margin: "auto" }}
          className="text-center"
        >
          <Card.Img variant="top" src={projet} />
          <Card.Body>
            <Card.Title>Collaboration</Card.Title>
            <Card.Text>Description de la première carte.</Card.Text>
          </Card.Body>
        </Card>
      </Carousel.Item>
      <Carousel.Item>
        <Card
          style={{ width: "18rem", margin: "auto" }}
          className="text-center"
        >
          <Card.Img variant="top" src="https://via.placeholder.com/150" />
          <Card.Body>
            <Card.Title>Deuxième carte</Card.Title>
            <Card.Text>Description de la deuxième carte.</Card.Text>
          </Card.Body>
        </Card>
      </Carousel.Item>
      <Carousel.Item>
        <Card
          style={{ width: "18rem", margin: "auto" }}
          className="text-center"
        >
          <Card.Img variant="top" src="https://via.placeholder.com/150" />
          <Card.Body>
            <Card.Title>Troisième carte</Card.Title>
            <Card.Text>Description de la troisième carte.</Card.Text>
          </Card.Body>
        </Card>
      </Carousel.Item>
    </Carousel>
  );
};

export default MyCarousel;
